// Sample event script to add custom HTTP header to all outgoing REST, SOAP and HTTP(S) calls
// This code is often used for adding custom authentication to SoapUI Pro tests

// If hardcoding the token, uncomment and change line 5
// def token = '4567'

// If your token is parameterized in Project level custom property, uncomment line 8
// def token = request.parent.testCase.testSuite.project.getProperty('auth_token').getValue()

// To modify all outgoing calls, remove comments from lines 11 to 16
// def headers = request.requestHeaders
// if (headers.containsKey('auth_token2') == false) {
//   headers.put('auth_token2', token)
//   request.requestHeaders = headers
// }

// Save all test step results into files
// Change the directory path in line 5 to a location where you want to store details
// then uncomment lines 5 to 10

// filePath = 'C:\\tempOutputDirectory\\'
// fos = new FileOutputStream(filePath + testStepResult.testStep.label + '.txt', true)
// pw = new PrintWriter(fos)
// testStepResult.writeTo(pw)
// pw.close()
// fos.close()

// Import the required classes
import com.eviware.soapui.impl.rest.actions.oauth.OltuOAuth2ClientFacade
import com.eviware.soapui.support.editor.inspectors.auth.TokenType
import com.eviware.soapui.model.support.ModelSupport

// Set up variables for Seller user
//def sellerCurrentUserAuth = testRunner.testCase.testSuite.project.getPropertyValue("sellerUserAuth")
//def sellerCurrentPasswordAuth = testRunner.testCase.testSuite.project.getPropertyValue("sellerPasswordAuth")
//testRunner.testCase.testSuite.project.setPropertyValue( "sellerCurrentUserAuth" , sellerCurrentUserAuth)
//testRunner.testCase.testSuite.project.setPropertyValue( "sellerCurrentPasswordAuth" , sellerCurrentPasswordAuth)

//Refresh token
def project = ModelSupport.getModelItemProject(context.getModelItem());
def profileList = ["SellerUser", "AdminUser", "SuperAdmin", "StoreManager"]

for (authProfileName in profileList){
	def authProfile = project.getAuthRepository().getEntry(authProfileName);
	def oldToken = authProfile.getAccessToken();
	def tokenType = TokenType.ACCESS;

	// Create a facade object
	def oAuthFacade = new OltuOAuth2ClientFacade(tokenType);

	// Request an access token in headless mode
	oAuthFacade.requestAccessToken(authProfile, true, true);

	// Wait until the access token gets updated
	for(int i = 0; i<=1000; i++){
	        if(oldToken != authProfile.getAccessToken()){
	        	// Post the info to the log
			log.info("Set new token: " + authProfile.getAccessToken());
	          break
	        }
	        sleep(1)
	    }
}

